import styled from 'styled-components/native';

export const HeaderView = styled.View`
    height: 30px;
    background-color: #eb4d4b;
    justify-content: center;
    align-items: center;
    text-weight: bold;
`;

export const HeaderText = styled.Text`
    text-align: center;
    color: #fff;
`;
